import * as React from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';

export default function Portfolio() {
    return (
        <Box
            component="form"
            sx={{
                '& > :not(style)': { m: 1},
            }}
            noValidate
            autoComplete="off"
        >
            <TextField id="outlined-basic" label="Project Name" variant="outlined" />
            <TextField id="outlined-basic" label="Project Members" variant="outlined" />
            <TextField id="outlined-basic" label="Project Description" variant="outlined" />
            <TextField id="outlined-basic" label="Technologies Used" variant="outlined" />
            <TextField id="outlined-basic" label="Project Link" variant="outlined" />
        </Box>
    );
}
